    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Selawik NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Selawik NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, information about the environment, information
    about the management direction, and strategies for implementation and monitoring.
    Key planning issues include: fish and wildlife habitat, transportation, hunting,
    public use, climate change, water quality and quantity, and outreach.",nt"owner_org":
